} It’s output wraps utility functions to generate size-optimized OCI-images: rec { entrypoint = std.std.lib.writeShellEntrypoint inputs { /* ... */ }; oci-image = entrypoint.mkOCI "docker.io/my-oci-image"; oci-debug-image = entrypoint.mkDebugOCI "docker.io/my-oci-image-debug";
